import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <Link to="/">Home</Link>
      <Link to="/cart">Carrinho</Link>
      <Link to="/login">Login</Link>
      <Link to="/register">Cadastro</Link>
    </header>
  );
};

export default Header;
